DROP TABLE IF EXISTS `bookings`;
CREATE TABLE `bookings` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `provider_id` int NOT NULL,
  `package_id` int NOT NULL,
  `service_type_id` int DEFAULT NULL,
  `pet_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pet_type` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pet_weight` decimal(5,2) DEFAULT NULL,
  `cause_of_death` text COLLATE utf8mb4_unicode_ci,
  `pet_image_url` mediumtext COLLATE utf8mb4_unicode_ci,
  `booking_date` date DEFAULT NULL,
  `booking_time` time DEFAULT NULL,
  `status` enum('pending','confirmed','in_progress','completed','cancelled','no_show') COLLATE utf8mb4_unicode_ci DEFAULT 'pending',
  `special_requests` text COLLATE utf8mb4_unicode_ci,
  `notes` text COLLATE utf8mb4_unicode_ci,
  `confirmation_code` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_method` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_status` enum('not_paid','partially_paid','paid','refunded','failed') COLLATE utf8mb4_unicode_ci DEFAULT 'not_paid',
  `delivery_option` enum('pickup','delivery') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `delivery_address` text COLLATE utf8mb4_unicode_ci,
  `delivery_distance` decimal(8,2) DEFAULT NULL,
  `delivery_fee` decimal(10,2) DEFAULT NULL,
  `base_price` decimal(10,2) DEFAULT NULL,
  `total_price` decimal(10,2) DEFAULT NULL,
  `refund_id` int DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_provider_id` (`provider_id`),
  KEY `idx_package_id` (`package_id`),
  KEY `idx_status` (`status`),
  KEY `idx_booking_date` (`booking_date`),
  KEY `idx_payment_status` (`payment_status`),
  KEY `idx_created_at` (`created_at`),
  KEY `idx_user_provider` (`user_id`,`provider_id`),
  KEY `idx_provider_status` (`provider_id`,`status`),
  KEY `idx_status_date` (`status`,`booking_date`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

