DROP TABLE IF EXISTS `pets`;
CREATE TABLE `pets` (
  `pet_id` int NOT NULL AUTO_INCREMENT,
  `user_id` int DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `species` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
